# Sample DNA string
dna_string = ""

# Define a dictionary for the complementary bases
complement = {'A': 'T', 'T': 'A', 'C': 'G', 'G': 'C'}

# Reverse the DNA string and then get the complement for each base
reverse_complement = "".join(complement[base] for base in reversed(dna_string))

# Output the reverse complement
print(reverse_complement)
